const MenuClassName = styled.ul`
	height: inherit;
	text-align: center;
	margin: 0;
	li {
		height: inherit;
		display: inline-block;
		a {
			position: relative;
			vertical-align: middle;
			font-size: 14px;
			line-height: 20px;
			font-weight: 600;
			padding: 15px;
